import { makeStyles } from "@material-ui/core/styles";

const NavBarMakeStyle = makeStyles((theme) => ({
  AppBar: {
    backgroundColor: "#5d89a2",
  },
  logo: {
    marginLeft: 30,
  },
  Tabs: {
    marginTop: "25px",
    marginLeft: "auto",
    fontFamily: "Roboto",
    marginRight: "12px",
  },

  tabItems: {
    color: white,
    textTransform: "none",
    fontWeight: "400",
    fontSize: "1rem",
    minWidth: 5,
    marginLeft: "25px",
  },
}));

export default NavBarMakeStyle;
